import React from "react";

const CollectionItem = ({ name, imageUrl, price }) => {
  return (
    <div>
      <img src={imageUrl}></img>
      <h4>{name}</h4>
      <span>{price} </span>
    </div>
  );
};
export default CollectionItem;
